import React from 'react';
import { HashRouter } from "react-router-dom";
import { useMediaQuery } from "react-responsive";
import Header from './Header';
import Footer from './Footer';
import Mainbox from './Mainbox';
import "../css.css";

function Main() {
    return (
        <div>
            <Header />
            <HashRouter>
            <div>
                <Mainbox />
            </div>
            </HashRouter>
        </div>
    )
}

export default Main;
